import React from "react";
import './style.css';

const Card = (props) =>{
    return(
    //     <div classNameName="container mt-2">
    //             <h5>{props.title}</h5>
    //             <img src={props.image} alt=""/>
    //             <p>{props.calories}</p>
    // </div>
            <div className="card mb-3">
            <div className="row g-0">
            <div className="col-md-4">
                <img src={props.image} className="img-fluid rounded-start" alt="..." />
            </div>
            <div className="col-md-8">
                <div className="card-body">
                <h5 className="card-title">{props.title}</h5>
                <ol>{props.ingredient.map(()=>ingredient.text)}</ol>
                <p className="card-text"><small className="text-muted">Calories{props.calories}</small></p>
                </div>
            </div>
            </div>
        </div>
    );
}

export default Card
